import * as React from 'react';
import Paper from '@material-ui/core/Paper';
import {
	Chart,
	BarSeries,
	Title,
	ArgumentAxis,
	ValueAxis,
} from '@devexpress/dx-react-chart-material-ui';
import { Animation } from '@devexpress/dx-react-chart';
import './ChartBar.scss';

const data = [
	{ day: 'Mon', population: 2.525 },
	{ day: 'Tue', population: 3.018 },
	{ day: 'Wed', population: 3.682 },
	{ day: 'Thu', population: 4.440 },
	{ day: 'Fri', population: 5.310 },
	{ day: '2000', population: 6.127 },
	{ day: '2010', population: 6.930 },
];

const ChartBar = () => {
	const [dataBar, setDataBar] = React.useState(data)
	return (
		<Paper>
			<Chart
				data={dataBar}
				height="400"
			>
				<ArgumentAxis />
				<ValueAxis max={7} />

				<BarSeries
					valueField="population"
					argumentField="year"
				/>
				<Animation />
			</Chart>
		</Paper>
	)
}

export default ChartBar;
